import './App.css';
import {BrowserRouter,Route} from 'react-router-dom';

function App() {
  return (
    <div>
        <BrowserRouter>
          <Route path='/'>Home</Route>
          <Route path='/about'>About</Route>
          <Route path='login'>Login</Route>
        </BrowserRouter>
    </div>
  );
}

export default App;
